import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Dashboard from "./pages/Dashboard";
import "./App.scss";

const App = () => {
  return (
    <>
      <Router>
        <Switch data="data">
          <div className="App" id="main">
            <header style={{ textAlign: "center" }}>
              <img src="https://camo.githubusercontent.com/e7701de364381a104733656a18a0c518a2509e0b/68747470733a2f2f63646e2e776562736974652d656469746f722e6e65742f37666166366431636366663434353934393538353337393465353966653962652f646d73337265702f6d756c74692f6d6f62696c652f426566656e695f6f686e655f436c61696d2e706e67" alt="beneni" />
            </header>
            <div className="row">
              <div className="col-md-3 box"></div>
              <div className="col-md-6 box">
                <div className="inner">
                  <Route exact path="/" component={Dashboard} />
                </div>
              </div>
              <div className="col-md-3 box"></div>
            </div>
          </div>
        </Switch>
      </Router>
    </>
  );
};

export default App;
